import React, { useState } from "react"

function Body(){

  const [dataToggle, setDataToggle] = useState("");
  const [dataTarget, setDataTarget] = useState("");
  
  function handleClick(){
    setDataToggle("collapse");
    setDataTarget("#navbarToggleExternalContent");
    // $("#navbarToggleExternalContent").animate({width:'toggle'},350)

    document.getElementById("navbar-toggler-icon").className += "toggleClick";
  }

    return (
  <header>
  <h1>Montana</h1>

  <div class="pos-f-t" id="my-navbar-collapse">
      <div class="collapse navbar-collapse" id="navbarToggleExternalContent">
        <div class="p-4 menu">
          <ul class="nav navbar-nav">

            <li>
              <a class="nav-link" href="#about-me">About</a>
            </li>
            <li>
              <a class="nav-link" href="#skills">Skills</a>
            </li>
            <li>
              <a class="nav-link" href="#contact-me">Contact</a>
            </li>
            <li>
              <a class="nav-link" href="Jeffin_Jaison_CV.pdf">CV</a>
            </li>
    
          </ul>
        </div>
      </div>
      <nav class="navbar navbar-dark">
        <button class="navbar-toggler" type="button" 
        data-toggle={dataToggle} data-target={dataTarget}
        onClick={handleClick}>
          <span class="toggle"></span>
        </button>
      </nav>
    </div>

</header>)
}

export default Body;


